                <div className="top">
                    <div className="top-text">
                        <p className="p-top"> THE BRAND <br/>
                            <span className="text_under-1">OF LUXERIOUS <span className="text-color-rosa">FASHION</span></span>
                        </p>
                    </div>
                </div>
            </div>
            {/*header*/}


        </div>
    )

}

export default HomePage
